('basic', 0, 1, 1, 'en', 0, '<div class=\"contact-info\">\r\n<span class=\"icon\"><i class=\"fa fa-globe\"></i></span>\r\n<h3>Contact info</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>\r\n<ul>\r\n<li><i class=\"fa fa-map-marker\"><span class=\"sr-only\">address</span></i> 1600 Amphitheatre Parkway, <br> Mountain View, CA 94043</li>\r\n<li><i class=\"fa fa-phone\"><span class=\"sr-only\">phone</span></i> +321 123 456 7 <br> +012 123 123 12</li><li><i class=\"fa fa-print\"><span class=\"sr-only\">fax</span></i> +321 123 456 8 <br> +21 123 456 87 </li>\r\n<li><i class=\"fa fa-envelope-o\"><span class=\"sr-only\">email</span></i>For general enquiries: <br> <a href=\"mailto:info@restaurantplus.com\">info@restaurantplus.com</a> <br> For sales enquiries: <br> <a href=\"mailto:sales@restaurantplus.com\">sales@restaurantplus.com</a></li>\r\n</ul>\r\n</div>', '', 'full_html'),
