('basic', 0, 4, 4, 'en', 0, '<ul class=\"icons-list text-center icons-list--large\">\r\n	<li><a href=\"http://www.facebook.com/morethan.just.themes/\"><i class=\"fa fa-facebook-square\"><span class=\"sr-only\">facebook</span></i></a></li>\r\n	<li><a href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter-square\"><span class=\"sr-only\">twitter</span></i></a></li>\r\n	<li><a href=\"http://www.linkedin.com/company/more-than-themes/\"><i class=\"fa fa-linkedin-square\"><span class=\"sr-only\">linkedin</span></i></a></li>\r\n	<li><a href=\"http://www.flickr.com/photos/morethanthemes/\"><i class=\"fa fa-flickr\"><span class=\"sr-only\">flickr</span></i></a></li>\r\n</ul>\r\n', '', 'full_html'),
('basic', 0, 5, 5, 'en', 0, '<div class=\"visible-md visible-lg\">Copyright Â© 2017 Restaurant Lite. all rights reserved.</div>\r\n<div class=\"text-center visible-xs visible-sm\">Copyright Â© 2017 Restaurant Lite. All rights reserved.</div>\r\n', '', 'full_html'),
('basic', 0, 6, 6, 'en', 0, '<div class=\"contact-info-items-grid\">\r\n  <div class=\"row\">\r\n    <div class=\"col-sm-4\">\r\n      <div class=\"contact-info-item clearfix\">\r\n        <div class=\"contact-info-item__icon\"><i class=\"fa fa-map-marker\"></i></div>\r\n        <div class=\"contact-info-item__text\">654 Charack Road Bloomington, <br> IN 47408</div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-sm-4\">\r\n      <div class=\"contact-info-item clearfix\">\r\n        <div class=\"contact-info-item__icon\"><i class=\"fa fa-phone\"></i></div>\r\n        <div class=\"contact-info-item__text\">Booking: (012) 345 - 6789 <br> Inquiries: 555 - 674 0097</div>\r\n      </div>\r\n    </div>\r\n    <div class=\"col-sm-4\">\r\n      <div class=\"contact-info-item clearfix\">\r\n        <div class=\"contact-info-item__icon\"><i class=\"fa fa-envelope-o\"></i></div>\r\n        <div class=\"contact-info-item__text\"><a href=\"mailto:info@contact-restaurant.com\">info@contact-restaurant.com</a> <br> <a href=\"mailto:sales@contact-restaurant.com\">sales@contact-restaurant.com</a></div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>', '', 'full_html'),
('basic', 0, 7, 7, 'en', 0, '<div class=\"overlay-container\"><img alt=\"sidebar image\" src=\"http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/restaurantplus/placeholders/block-img.jpg\" /></div>\r\n\r\n<h3><a href=\"#\">Sidebar block with image</a></h3>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do <a href=\"#\">eiusmod tempor</a> incididunt ut labore et dolore magna aliqua.</p>\r\n\r\n<p class=\"more-link\"><a href=\"#\">read more</a></p>\r\n', '', 'full_html'),
('basic', 0, 8, 8, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-7\">\r\n<ul class=\"inline-list inline-list--vertical-paddings sm-text-center\">\r\n<li class=\"inline-list__item\">\r\n<i class=\"inline-list__icon fa fa-map-marker text--colored-secondary\"><span class=\"sr-only\">location</span></i> 1654 Charack Road Bloomington, IN 47408\r\n</li>\r\n<li class=\"inline-list__item\">\r\n<i class=\"inline-list__icon fa fa-phone text--colored-secondary\"><span class=\"sr-only\">tel</span></i> (012) 345 - 6789\r\n</li>\r\n<li class=\"inline-list__item hidden-md\">\r\n<i class=\"inline-list__icon fa fa-clock-o text--colored-secondary\"><span class=\"sr-only\">opening hours</span></i> Mon-Fri: 9am-10pm\r\n</li>\r\n<li class=\"inline-list__item hidden-md\">\r\nSun: 8am-11pm\r\n</li>\r\n</ul>\r\n</div>\r\n<div class=\"col-md-5\">\r\n<div class=\"text-right xs-text-center sm-text-center\">\r\n<ul class=\"inline-list\">\r\n<li class=\"inline-list__item\">\r\n<span class=\"visible-lg\">Follow Us On Social Media:</span>\r\n</li>\r\n<li class=\"inline-list__item\">\r\n<ul class=\"icons-list icons-list--square icons-list--stripped\">\r\n<li>\r\n<a href=\"#\">\r\n<i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i>\r\n</a>\r\n</li>\r\n<li>\r\n<a href=\"#\">\r\n<i class=\"fa fa-instagram\"><span class=\"sr-only\">instagram</span></i>\r\n</a>\r\n</li>\r\n<li>\r\n<a href=\"#\">\r\n<i class=\"fa fa-pinterest\"><span class=\"sr-only\">pinterest</span></i>\r\n</a>\r\n</li>\r\n<li>\r\n<a href=\"#\">\r\n<i class=\"fa fa-youtube\"><span class=\"sr-only\">youtube</span></i>\r\n</a>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', '', 'full_html'),
('basic', 0, 10, 10, 'en', 0, '<div class=\"background-image-block__section field--mt-background-image-block\">\r\n<div class=\"background-image\" style=\"background-image: url(http://mttprojects.s3.amazonaws.com/demo.drupalizing.com/restaurant-lite/background-image-banner.jpg);\">&nbsp;</div>\r\n\r\n<div class=\"background-image-overlay region--light-typography region--black-background\" style=\"opacity: 0.6;\">&nbsp;</div>\r\n\r\n<div class=\"container-fluid region--light-typography region--black-background\">\r\n<div class=\"row bottom-spacing-medium top-spacing-medium\">\r\n<div class=\"col-md-8 col-md-offset-2 text-center\">\r\n<h3 class=\"block-title block-title--extra-large\">RESTAURANT LITE</h3>\r\n\r\n<div class=\"bottom-spacing-small top-spacing-small\">\r\n<p class=\"large\">A spot where the food is simple â€” yet great.</p>\r\n\r\n<p class=\"large\">From tasty tacos to great pasta, we have it all.</p>\r\n</div>\r\n\r\n<div class=\"bottom-spacing-medium\">\r\n<p class=\"text-center\"><a class=\"button\" href=\"#\">Book a table</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 11, 11, 'en', 0, '<div class=\"text-center subscribe\">\r\n<h5 class=\"text--colored\">Newsletter</h5>\r\n<h2>Subscribe To Receive Our <br> Latest News</h2>\r\n<p>Subscribe to our newsletter <br> to receive our latest news &amp; promotions!</p>\r\n<form action=\"#\" class=\"container-inline\">\r\n<div class=\"form-item form-type-textfield\">\r\n<input class=\"form-text\" name=\"subscribe\" onblur=\"if (this.value == \'\') {this.value = \'Email Address\';}\" onfocus=\"if (this.value == \'Your email address\') {this.value = \'\';}\" type=\"text\" value=\"Email Address\" />\r\n</div>\r\n<div class=\"form-actions\">\r\n<input class=\"form-submit\" id=\"edit-submit-4\" name=\"submit\" type=\"submit\" value=\"Submit\" />\r\n<small>We promise not to send you any spam, never ever.</small>\r\n</div>\r\n</form>\r\n</div>', '', 'full_html'),
('basic', 0, 12, 12, 'en', 0, '<div class=\"view-header view-featured-article\">\r\n<h5 class=\"text--colored\">Blog</h5>\r\n</div>\r\n\r\n<div class=\"view-content\">\r\n<div class=\"views-row\">\r\n<div class=\"views-field views-field-title view-featured-article\">\r\n<h2 class=\"field-content\"><a href=\"node/3\" hreflang=\"en\">First Article</a></h2>\r\n</div>\r\n\r\n<div class=\"views-field views-field-created view-featured-article\"><span class=\"field-content\"><i class=\"fa fa-calendar-o\"></i>&nbsp;Posted 07/June/2016</span></div>\r\n\r\n<div class=\"views-field views-field-body view-featured-article\">\r\n<div class=\"field-content\">\r\n<p>Phosfluorescently e-enable adaptive synergy for strategic quality vectors. Continually transform fully tested expertise <a href=\"#\">with competitive technologies</a>. Appropriately communicate adaptive imperatives rather thanâ€¦</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"views-field views-field-nothing view-featured-article\">\r\n<p><a class=\"button button--hover-style-2\" href=\"node/3\">Read Article</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 13, 13, 'en', 0, '<div class=\"row\">\r\n<div class=\"text-center col-md-10 col-md-offset-1\">\r\n<h2 class=\"block-title block-title--extra-large\">Best Restaurant in Town</h2>\r\n\r\n<p class=\"large\">Each location offers a full menu of authentic Mexican food cuisine, including enchiladas, burritos, tacos &amp; tortas.</p>\r\n\r\n<p class=\"bottom-spacing-small\">As the expansion grew to the point of diminishing returns somewhere in the mid eighties, they both began to sell off their less popular shops. We currently have three locations: Chattanooga and Nashville, Tennessee.</p>\r\n\r\n<p><a class=\"button button--hover-style-2\" href=\"#\">Learn About Us</a></p>\r\n</div>\r\n</div>\r\n', '', 'full_html');

